-- ----------------------------
-- Table structure for repair_rep_tb
-- ----------------------------
DROP TABLE IF EXISTS `repair_rep_tb`;
CREATE TABLE `repair_rep_tb`  (
  `repair_id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '报修单自增主键',
  `repair_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报修单编号',
  `repair_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报修地点',
  `repair_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '报修内容',
  `repair_money` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '维修单单价',
  `repair_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '维修类型：网络设备、水电类、家具类、办公室设备',
  `repair_expect_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '期望维修形式(换新、换配件、维修)',
  `repair_expect_time` datetime(0) NULL DEFAULT NULL COMMENT '期望维修时间',
  `repair_state` tinyint(0) NULL DEFAULT 1 COMMENT '报修状态（1待接单、2已接单、3转单中、4已完成单）',
  `repaired_state` tinyint(0) NULL DEFAULT 0 COMMENT '维修后设备状态描述(0待修、1已修复、2已换新、3未修复、4无法修复)',
  `repair_destory` tinyint(0) NULL DEFAULT 0 COMMENT '是否销单（0未销单，1已销单）',
