  `repair_comment` tinyint(0) NULL DEFAULT 0 COMMENT '是否评论（0未评论，1已评论）',
  `cur_work` tinyint(0) NULL DEFAULT 1 COMMENT '是否为当前运转单（0不是、1是）【用于转单所生成新的维修单与旧的维修单区别】',
  `repair_dep` bigint(0) NULL DEFAULT NULL COMMENT '初次报修所属部门id',
  `apply_id` bigint(0) NULL DEFAULT NULL COMMENT '申请表id',
  `repair_destory_time` datetime(0) NULL DEFAULT NULL COMMENT '销单时间',
  `repair_create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `repair_is_delete` tinyint(0) NULL DEFAULT 0 COMMENT '逻辑删除状态（0存在，1删除）',
  `repair_year` int(0) NULL DEFAULT NULL COMMENT '报修年份',
  `repair_month` int(0) NULL DEFAULT NULL COMMENT '报修月份',
  `repair_day` int(0) NULL DEFAULT NULL COMMENT '报修日份',
  `repair_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报修者姓名',
  PRIMARY KEY (`repair_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 387 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '报修单' ROW_FORMAT = DYNAMIC;

